import React from "react";
// import MealsImg from "../../Assets/res.jpg"
import classes from "./Header.module.css"
const Header = (props) => {
  return (
    <React.Fragment>
      <header className={classes.header}>
        <h1>Hari_Meals</h1>
        <button>Cart</button>
      </header>
      <div>
        <img src="{MealsImg}" alt="GG"/>       
      </div>
    </React.Fragment>
  );
};

export default Header;
